완제품으로 배달되어서 좋았어요 신경안써도 되고.. 앉아보니 쿠션감은 적당 의자도 튼튼하고 칼라도 마음에 들어요 근데 신체가 크신분은 좀 고려해야할듯... 전 아담사이즈라 적당하네요 단지 흠이 있다면 의자가 너무 높아요;
판매사장님 말씀대로 아래플라스틱을 드라이버로 빼내려했지만 제겐 힘이 딸려서인지 꿈쩍안하네요
할수없이 그냥 쓰려니 다리가 붕 떠서 대체품으로 발아래에 상자를 놓고 다리를 받치니 이제 좀 나으네요 저같이 아담사이즈인분은 다리밑에 있는 플라스틱을 빼서 주문하시면 좋을듯해요

상자안에 2개가 기본 한세트라는 얘긴줄알고 1주문했는데 그게아니군요^^;;;;;
2개씩 포장돼있는데 제가1개사서 1개꺼내고 1개만 온거네요 하나더사야겠어요
색깔도좋고 튼튼하고 배송 로젠택배분이 진짜친절하셨어요
